import store from "../redux/store"; // The store and main reducer
import DisplayOnly from "../components/DisplayOnly";
import UpdateOnly from "../components/UpdateOnly";
import DisplayAndUpdate from "../components/DisplayAndUpdate";
import { useEffect } from "react";

const requestActivity = async (url) => {
  let response = await fetch(url);
  let activityData = await response.json();
  return activityData
}

const App = () => {

  useEffect(() => {
    requestActivity("https://api.publicapis.org/entries?category=jobs&https=true").then(current => {
      setData(current)
    })
  },[])
  return(<Provider store={store}>

    <DisplayOnly />
    <UpdateOnly />
    <DisplayAndUpdate />
  </Provider>)
}
export default App;
